package expression.generic;public class GenericVariable<T> implements GenericGeneralExpression<T> {    protected String var;    protected NumberMode<T> calculator;    public GenericVariable(String var) {        this.var = var;    }    @Override    public T evaluate(T val) {        return val;    }    @Override    public T evaluate(T val1, T val2, T val3) {        if (var.equals("x")) {            return val1;        } else if (var.equals("y")) {            return val2;        } else {            return val3;        }    }    @Override    public String toString() {        return var;    }    @Override    public boolean equals(Object object) {        if (object == null || this.getClass() != object.getClass()) {            return false;        }        GenericVariable<?> var2 = (GenericVariable<?>) object;        return var.equals(var2.var);    }    @Override    public int hashCode() {        return 17 * var.hashCode();    }}